

# gets the product of a list of string numeric objects
# converts the strings to integers
# returns product
def listProd(ls_string):
	number = 1
	for n in ls_string:
		number *= int(n)
	return number

# gets the largest product of 5 digits in the input number
# input number must be a string
# returns the maximum
def getLargest5DigitInt(numeric_string):
	product = []
	for i in range(0,len(numeric_string)-4):
		#print i, ":", numeric_string[i:i+5], ":", listProd(numeric_string[i:i+5]) #debug
		product.append(listProd(numeric_string[i:i+5]))

	#print product #debug
	return max(product)


